import React from 'react';
import Amazon from './Amazon';
import List from './List';
import Netflex from './Netflex';
import Sdata from './Sdata';

const myFav = 'Netflex';
function App() {
  return (
    <>
      (myFav=== 'Netflex') ? <Netflex /> : <Amazon />
    </>
  );
}

export default App;
